import Course from "./Course";

const CourseList = ({ courseList, onDelete }) => {
  return (
    <div>
      {courseList.map((course) => (
        <Course key={course.id} course={course} onDelete={onDelete} />
      ))}
    </div>
  );
};

export default CourseList;
